import React from "react";

const FuncionarioPage = () => {
  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-4">Funcionários</h1>
      <p>Bem-vindo à página de funcionários!</p>
    </div>
  );
};

export default FuncionarioPage;
